import { dummyPost } from '../dummy.js';
export default function Boardpostform(){
    if(dummyPost.content.length>7)
    return(
        <div>
            <center>
            <div id='item-list-container'>
            <div id='item-list-body'>
            <div>
            <img className='item-img' src={dummyPost[0].image} alt={dummyPost[0].title} />
            <span className='item-name' >{dummyPost[0].title}</span>
            <span className='item-price' >{dummyPost[0].contents}</span>
            <span className='item-price' >{dummyPost[0].total_likes}</span>
            </div>

        </div>
        </div>
        </center>
        </div>
    )
}
